This class provides a container DD instance that allows dropping on multiple child target nodes.

By default, this class requires that child nodes accepting drop are registered with <a href='#!/api/Ext.dd.Registry'>Ext.dd.Registry</a>.
However a simpler way to allow a DropZone to manage any number of target elements is to configure the
DropZone with an implementation of <a href='#!/api/Ext.dd.DropZone-method-getTargetFromEvent'>getTargetFromEvent</a> which interrogates the passed
mouse event to see if it has taken place within an element, or class of elements. This is easily done
by using the event's <a href='#!/api/Ext.event.Event-method-getTarget'>Ext.event.Event#getTarget</a> method to identify a node based on a
CSS selector.

Once the DropZone has detected through calling getTargetFromEvent, that the mouse is over
a drop target, that target is passed as the first parameter to <a href='#!/api/Ext.dd.DropZone-method-onNodeEnter'>onNodeEnter</a>, <a href='#!/api/Ext.dd.DropZone-method-onNodeOver'>onNodeOver</a>,
<a href='#!/api/Ext.dd.DropZone-method-onNodeOut'>onNodeOut</a>, <a href='#!/api/Ext.dd.DropZone-method-onNodeDrop'>onNodeDrop</a>. You may configure the instance of DropZone with implementations
of these methods to provide application-specific behaviour for these events to update both
application state, and UI state.

For example to make a GridPanel a cooperating target with the example illustrated in
<a href='#!/api/Ext.dd.DragZone'>Ext.dd.DragZone</a>, the following technique might be used:

    myGridPanel.on('render', function() {
        myGridPanel.dropZone = new Ext.dd.DropZone(myGridPanel.getView().scroller, {

            // If the mouse is over a grid row, return that node. This is
            // provided as the "target" parameter in all "onNodeXXXX" node event handling functions
            getTargetFromEvent: function(e) {
                return e.getTarget(myGridPanel.getView().rowSelector);
            },

            // On entry into a target node, highlight that node.
            onNodeEnter : function(target, dd, e, data){
                Ext.fly(target).addCls('my-row-highlight-class');
            },

            // On exit from a target node, unhighlight that node.
            onNodeOut : function(target, dd, e, data){
                Ext.fly(target).removeCls('my-row-highlight-class');
            },

            // While over a target node, return the default drop allowed class which
            // places a "tick" icon into the drag proxy.
            onNodeOver : function(target, dd, e, data){
                return Ext.dd.DropZone.prototype.dropAllowed;
            },

            // On node drop we can interrogate the target to find the underlying
            // application object that is the real target of the dragged data.
            // In this case, it is a Record in the GridPanel's Store.
            // We can use the data set up by the DragZone's getDragData method to read
            // any data we decided to attach in the DragZone's getDragData method.
            onNodeDrop : function(target, dd, e, data){
                var rowIndex = myGridPanel.getView().findRowIndex(target);
                var r = myGridPanel.getStore().getAt(rowIndex);
                Ext.Msg.alert('Drop gesture', 'Dropped Record id ' + data.draggedRecord.id +
                    ' on Record id ' + r.id);
                return true;
            }
        });
    }

See the <a href='#!/api/Ext.dd.DragZone'>Ext.dd.DragZone</a> documentation for details about building a DragZone which
cooperates with this DropZone.

Initializes the drag drop object's constraints to restrict movement to a certain element.

Usage:

    var dd = new Ext.dd.DDProxy("dragDiv1", "proxytest",
                   { dragElId: "existingProxyDiv" });
    dd.startDrag = function(){
        this.constrainTo("parent-id");
    };

Or you can initalize it using the <a href='#!/api/Ext.dom.Element'>Ext.dom.Element</a> object:

    Ext.get("dragDiv1").initDDProxy("proxytest", {dragElId: "existingProxyDiv"}, {
        startDrag : function(){
            this.constrainTo("parent-id");
        }
    });

An object who's property names identify the IDs of elements to be considered invalid as drag handles.
A non-null property value identifies the ID as invalid. For example, to prevent
dragging from being initiated on element ID "foo", use:

    {
        foo: true
    }

An object who's property names identify HTML tags to be considered invalid as drag handles.
A non-null property value identifies the tag as invalid. Defaults to the
following value which prevents drag operations from being initiated by `<a>` elements:

    {
        A: "A"
    }
